import React from "react";

const ItemCard = (props) => {

  const storage = props.storage;

  const setStore = storage.map((item) => {
    return (
      <div className="col-md-4">
        <div className="thumbnail text-center">
          <a href={`${item.email}`} >
            <img src="./" alt={item.id} />
            <p>{item.name}</p>
          </a>
        </div>
      </div>
    )
  })


  return(
    <div>
      {setStore}
    </div>
  )
}

export default ItemCard;
